be%20an%20integer%20number%20of%20pixels.%20%20If%20the%20glyphs%20are%20positioned%20with%20sub-pixel%20accuracy%20according%20%20to%20these%20scaled%20design%20metrics%20then%20the%20rasterization%20would%20%20ideally%20need%20to%20be%20adjusted%20for%20each%20possible%20sub-pixel%20origin.%20%20%20%20Unfortunately%2C%20scaling%20each%20glyph%20customized%20to%20its%20exact%20%20subpixel%20origin%20during%20text%20layout%20would%20be%20prohibitively%20%20expensive%20so%20a%20simplified%20system%20based%20on%20integer%20device%20%20positions%20is%20typically%20used%20to%20lay%20out%20the%20text.%20%20The%20rasterization%20of%20the%20glyph%20and%20the%20scaled%20advance%20width%20%20are%20both%20adjusted%20together%20to%20yield%20text%20that%20looks%20good%20at%20%20device%20resolution%20and%20has%20consistent%20integer%20pixel%20distances%20%20between%20glyphs%20that%20help%20the%20glyphs%20look%20uniformly%20and%20%20consistently%20spaced%20and%20readable.%20%20%20%20This%20process%20of%20rounding%20advance%20widths%20for%20rasterized%20glyphs%20%20to%20integer%20distances%20means%20that%20the%20character%20density%20and%20the%20%20overall%20length%20of%20a%20string%20of%20text%20will%20be%20different%20from%20the%20%20theoretical%20design%20measurements%20due%20to%20the%20accumulation%20of%20%20a%20series%20of%20small%20differences%20in%20the%20adjusted%20widths%20of%20%20each%20glyph.%20%20The%20specific%20differences%20will%20be%20different%20for%20each%20glyph%2C%20%20some%20being%20wider%20and%20some%20being%20narrower%20than%20their%20theoretical%20%20design%20measurements.%20%20Thus%20the%20overall%20difference%20in%20character%20density%20and%20length%20%20will%20vary%20by%20a%20number%20of%20factors%20including%20the%20font%2C%20the%20%20specific%20device%20resolution%20being%20targeted%2C%20and%20the%20glyphs%20%20chosen%20to%20represent%20the%20string%20being%20rendered.%20%20As%20a%20result%2C%20rendering%20the%20same%20string%20at%20multiple%20device%