,'Standard%20subscript.','TextAttribute'),(1240,'public static final TextAttribute FONT','null','null','null','null','Attribute%20key%20used%20to%20provide%20the%20font%20to%20use%20to%20render%20text.%20%20Values%20are%20instances%20of%20Font.%20%20The%20default%20%20value%20is%20null%2C%20indicating%20that%20normal%20resolution%20of%20a%20%20Font%20from%20attributes%20should%20be%20performed.%20%20%20TextLayout%20and%20%20AttributedCharacterIterator%20work%20in%20terms%20of%20%20Maps%20of%20TextAttributes.%20%20Normally%2C%20%20all%20the%20attributes%20are%20examined%20and%20used%20to%20select%20and%20%20configure%20a%20Font%20instance.%20%20If%20a%20FONT%20%20attribute%20is%20present%2C%20though%2C%20its%20associated%20Font%20%20will%20be%20used.%20%20This%20provides%20a%20way%20for%20users%20to%20override%20the%20%20resolution%20of%20font%20attributes%20into%20a%20Font%2C%20or%20%20force%20use%20of%20a%20particular%20Font%20instance.%20%20This%20%20also%20allows%20users%20to%20specify%20subclasses%20of%20Font%20in%20%20cases%20where%20a%20Font%20can%20be%20subclassed.%20%20%20FONT%20is%20used%20for%20special%20situations%20where%20%20clients%20already%20have%20a%20Font%20instance%20but%20still%20%20need%20to%20use%20Map-based%20APIs.%20%20Typically%2C%20there%20will%20%20be%20no%20other%20attributes%20in%20the%20Map%20except%20the%20%20FONT%20attribute.%20%20With%20Map-based%20APIs%20%20the%20common%20case%20is%20to%20specify%20all%20attributes%20individually%2C%20so%20%20FONT%20is%20not%20needed%20or%20desireable.%20%20%20However%2C%20if%20both%20FONT%20and%20other%20attributes%20are%20%20present%20in%20the%20Map%2C%20the%20rendering%20system%20will%20%20merge%20the%20attributes%20defined%20in%20the%20Font%20with%20the%20%20additional%20attributes.%20%20This%20merging%20process%20classifies%20%20TextAttributes%20into%20two%20groups.%20%20One%20group%2C%20the%20%20%27primary%27%20group%2C%20is%20considered%20fundamental%20to%20the%20selection%20and%20%20metric%20behavior%20of%20a%20font.%20%20These%20attributes%20are%20%20FAMILY%2C%20WEIGHT%2C%20WIDTH%2C%20%20POSTURE%2C%20SIZE%2C%20%20TRANSFORM%2C%20SUPERSCRIPT%2C%20and%20%20TRACKING.%20The%20other%20group%2C%20the%20%27secondary%27%20group%2C%20%20consists%20of%20all%20other%20defined%20attributes%2C%20with%20the%20exception%20of%20%20FONT%20itself.%20%20%20To%20generate%20the%20new%20Map%2C%20first%20the%20%20Font%20is%20obtained%20from%20the%20FONT%20%20attribute%2C%20and%20all%20of%20its%20attributes%20extracted%20into%20a%20%20new%20Map.%20%20Then%20only%20the%20secondary%20%20attributes%20from%20the%20original%20Map%20are%20added%20to%20%20those%20in%20the%20new%20Map.%20%20Thus%20the%20values%20of%20primary%20%20attributes%20come%20solely%20from%20the%20Font%2C%20and%20the%20%20values%20of%20secondary%20attributes%20originate%20with%20the%20%20Font%20but%20can%20be%20overridden%20by%20other%20values%20in%20the%20%20Map.%20%20%20Note%3AFont%27s%20Map-based%20%20constructor%20and%20deriveFont%20methods%20do%20not%20process%20%20the%20FONT%20attribute%2C%20as%20these%20are%20used%20to%20create%20%20new%20Font%20objects.%20%20Instead%2C%20Font.getFont%28Map%29%20should%20be%20used%20to%20%20handle%20the%20FONT%20attribute.','TextAttribute'),(1241,'public static final TextAttribute CHAR_REPLACEMENT','null','null','null','null','Attribute%20key%20for%20a%20user-defined%20glyph%20to%20display%20in%20lieu%20%20of%20the%20font%27s%20standard%20glyph%20for%20a%20character.%20%20Values%20are%20%20intances%20of%20GraphicAttribute.%20%20The%20default%20value%20is%20null%2C%20%20indicating%20that%20the%20standard%20glyphs%20provided%20by%20the%20font%20%20should%20be%20used.%20%20%20This%20attribute%20is%20used%20to%20reserve%20space%20for%20a%20graphic%20or%20%20other%20component%20embedded%20in%20a%20line%20of%20text.%20%20It%20is%20required%20for%20%20correct%20positioning%20of%20%27inline%27%20components%20within%20a%20line%20when%20%20bidirectional%20reordering%20%28see%20Bi